import React from "react";
import Slider from "react-slick";
import "slick-carousel/slick/slick.css";
import "slick-carousel/slick/slick-theme.css";
import "../css/mainBlock.css";
import doctor from "../img/doctor.png";

function MySlider() {
  const settings = {
    arrows: false,
    dots: true,
    fade: true,
    autoplay: false,
    // autoplay: 2500,
    pauseOnHover: false,
  };
  return (
    <div className="mySlider">
      <Slider {...settings} className="hello">
        <div className="slide1">
          <nav>
            <div className="slider-container">
              <article>
                <h2>Hello Doc</h2>
                <h1>Lorem ipsum dolor</h1>
                <p>
                  Lorem ipsum dolor sit amet consectetur adipisicing elit.
                  Mollitia id impedit quas earum architecto iste facilis,
                  consequatur minus suscipit! Ea atque alias distinctio quis
                  expedita saepe impedit doloremque reiciendis recusandae!
                </p>
                <button>Press</button>
              </article>
            </div>
          </nav>
        </div>
        <div className="slide2">
          <nav>
            <img className="doc" src={doctor}></img>
          </nav>
        </div>
        <div className="slide3">
          <nav></nav>
        </div>
      </Slider>
    </div>
  );
}
export default MySlider;
